There are three theories about the origins of name Tewdrig:

a variant of the Germanic name Theodoric;
it may have been North British, as the name Theodric had been a royal name in Bernicia and/or;
or the Breton royal name Theuderic.Tewdrig's father, Teithfallt, had also been a king, and the Book of Llandaff notes that during his reign the Saxons had devastated the border regions, chiefly to the northwest near Hereford (i.e., in the historical Kingdom of Ergyng), and also along the River Wye.
